r26.update(long_description: "I thought I would hate these kitchen cabinets because they look so industrial/run down in the icons, but they actually work really well full-sized. I do regret that this kitchen looks so poorly lit. The staircase that leads up to the next floor opens up to the outdoors which always messes up the lighting during the day. Still, it's a simple, straightforward kitchen for your perusing.")
r27.update(long_description: "Full disclosure: I remodeled this home after I got some more practice in, and I think this might be my most favorite part of the update. This staircase lead down into the kitchen/dining room area, which might be an issue when it rains, but since I haven't gotten Seasons yet, it's all good. I'm in love with the slatted wooden wall that came with the Spa Day pack that makes an amazing backdrop to all of the plants I wanted to put here. And that climbing ivy? Pure perfection. One thing that this photo doesn't do justice to is that there's an overhang made of fencing that contains a bunch of plants, to provide some cover. It's a really cool technique, but it does take some work.")
r28.update(long_description: "I truly wouldn't have guessed that a dark brown would be a beautiful color for a bathroom, but this print makes it feel like a relaxing spa that you can just stumble into. There is a giant bath tub on the left side of this bathroom with two windows that sit just above it, shrouded by an awning smothered in plants. It's visible in the picture of the back of the house, but I couldn't capture a great picture of this full bathroom. In the mirror's reflection, though, you can see the plant wall painting and a medicine cabinet that sits above the toilet. I truly just love the serenity that this bathroom brings.")
r29.update(long_description: "What's not quite visible from this photo is that the roof is made of glass in this walkway. When I finally get the seasons pack, I can imagine this being such a beautiful place to rest when the rain falls. I'd probably add some chairs or benches to really take full advantage. This walkway connects a study/seating area with the kid's bedroom. I feel like it might impinge on privacy, but that only matters to the Sims in matters of the bathroom.")
r30.update(long_description: "In the very beautiful house that this room exists in, this room takes advantage of all of its best parts: floor to ceiling windows that let in a ton of light, abstract rugs, calming black and white, and an appropriate number of plants. It's truly a good thing that there's no seasons in the Sims in the base game because this house would not fare well.")
r31.update(long_description: "I think I'm learning through this process that using yellow at some point is my trademark style. I can't help that it's a beautiful, warm color that brings joy to every room, yknow. To be fair, I did use lots of muted colors in this house otherwise to let the yellow pop. The walls are actually a bamboo/darker green, but in this light they look gray/black. I wanted to invoke a modern, slick forest that was very connected to the outdoors.")
